import BurgerBuilder from './containers/BurgerBuilder/BurgerBuilder'
import Checkout from './containers/Checkout/Checkout';

import { Route } from 'react-router-dom';

const App = ()  => {
  return (
    <div>
      {/* <Layout>
        <BurgerBuilder />
      </Layout> */}

      <Route path="/checkout" render={() => <Layout><BurgerBuilder /></Layout>} />
      <Route path="/" render={() => <Layout><BurgerBuilder /></Layout>} />
    </div>
  );
}

export default App;
